import base64

# Base64 encoded image string (truncated for brevity, ensure you have the full string in your actual use case)
base64_string = "";

# Add padding if necessary
padding_needed = 4 - (len(base64_string) % 4)
if padding_needed:
    base64_string += "=" * padding_needed

# Decode the Base64 string
image_data = base64.b64decode(base64_string)

# Save the decoded bytes to an image file
with open("decoded_images.pdf", "wb") as f:
    f.write(image_data)

print("Image saved as decoded_image.jpg")

